webpackJsonp([0xc724f664a220],{4990:function(e,n){e.exports={data:{post:{html:'<p>I managed to break my Internet server so that I can no longer log in over the network. Since it is in Maryland and I am in Germany, it is a bit inpractical for me to log in directly! So until my hosting service can help me out, the <a href="http://www.mausnews.de">Maus Newsletter</a> is down, and E-mail sent to shcon.con or mausnews.de isn\'t being delivered. In the meantime, we can be reached at <a href="mailto:shanson@freenet.de">shanson@freenet.de</a> <b>Update Sunday 9 Jan 4 pm</b> The machine is back up! I\'ll slowly get everything running again.</p>',fields:{title:"Ooops!",date:"08 Jan 2000",url:"https://papascott.de/2000-01-08-ooops/"}}},pathContext:{slug:"/2000-01-08-ooops/",prev:{fields:{title:"He's now official",date:"07 Jan 2000",slug:"/2000-01-07-hes-now-official/"}},next:{fields:{title:"Reflections on childbirth",date:"09 Jan 2000",slug:"/2000-01-09-reflections-on-childbirth/"}}}}}});
